import React from 'react';
import { useNavigate } from 'react-router-dom';
import { Route, Routes } from 'react-router-dom';

const Semster = () => {
    const navigate = useNavigate();
    return (
        <div className="bg-gray-200 p-6 cursor-pointer">
            sdfhesdjf
            <h1
                onClick={() => {
                    navigate('economy');
                }}
            >
                Economy
            </h1>
            <h1
                onClick={() => {
                    navigate('maths');
                }}
            >
                Maths
            </h1>
            <h1
                onClick={() => {
                    navigate('english');
                }}
            >
                English
            </h1>
            <Routes>
                <Route path="economy" element={<Subject subject="Economy" />} />
                <Route path="maths" element={<Subject subject="Maths" />} />
                <Route path="english" element={<Subject subject="English" />} />
            </Routes>
        </div>
    );
};

export default Semster;
